import React, { Component } from 'react'
import {Link, Redirect} from "react-router-dom"
export default class Admin extends Component {
  constructor(props){
    super(props)
    const tokenn=localStorage.getItem("token")
    let loggedInn=true
    if (tokenn=== null){
      loggedInn=false
    }
    this.state={
      loggedInn

    }
  }



  render() {
    if(this.state.loggedInn=== false){
    return  <Redirect to="/"/>
    }
    return (
      <div>admin page
{this.tokenn}
      </div>
    )
  }
}
